import Box from "@mui/material/Box";
import "./ShowBox.css";
import styled, { css } from "styled-components";

const ShowBox = () => {
  return (
    <>
      <Box
        className="Round-box-right"
        sx={{
          width: "auto",
          maxWidth: "600px",
          height: 100,
          alignItems: "center",
          backgroundColor: "white",
          margin: "left",
        }}
      >
        hello
      </Box>
      <Box
        className="Round-box-left"
        sx={{
          width: "auto",
          maxWidth: "600px",
          height: 100,
          alignItems: "center",
          backgroundColor: "white",
          margin: "right",
        }}
      >
        hello
      </Box>
      <Box
        sx={{
          width: "auto",
          height: 500,
          alignItems: "center",
          backgroundColor: "white",
          margin: "auto",
        }}
      ></Box>
    </>
  );
};

export default ShowBox;
